import datetime
import logging
from enum import Enum
from typing import List, Dict, Optional

# Setup logging
logging.basicConfig(filename='submission_system.log', level=logging.INFO)

class PublishStatus(Enum):
    DRAFT = "Draft"
    PENDING = "Pending"
    PUBLISHED = "Published"
    FAILED = "Failed"

class SiteLock:
    def __init__(self):
        self._is_locked = False
        self._lock_reason = ""
        self._lock_time = None

    def lock_site(self, reason: str):
        self._is_locked = True
        self._lock_reason = reason
        self._lock_time = datetime.datetime.now()
        logging.info(f"Site locked at {self._lock_time} for reason: {reason}")

    def unlock_site(self):
        self._is_locked = False
        self._lock_reason = ""
        logging.info(f"Site unlocked at {datetime.datetime.now()}")

    def is_locked(self) -> bool:
        return self._is_locked

site_lock = SiteLock()

class Submission:
    def __init__(self, submission_id: str, creator: str, created_at: datetime.datetime):
        self.id = submission_id
        self.creator = creator
        self.created_at = created_at
        self.publish_status = PublishStatus.DRAFT
        self.flexfields = {}
        self.published = False
        self.last_updated = created_at

    def update_publish_status(self, status: PublishStatus):
        self.publish_status = status
        self.last_updated = datetime.datetime.now()
        logging.info(f"Submission {self.id} status updated to {status.value}")

    def add_flexfields(self, fields: Dict):
        self.flexfields.update(fields)
        logging.info(f"Added {len(fields)} flexfields to submission {self.id}")

    def generate_d_file(self) -> str:
        if self.published:
            logging.warning(f"Submission {self.id} already published, cannot regenerate D file")
            return ""

        d_file_content = f"D File for submission {self.id}\nGenerated at {datetime.datetime.now()}"
        logging.info(f"Generated D file for submission {self.id}")
        return d_file_content

    def publish(self):
        if self.published:
            raise ValueError("Submission already published")

        if site_lock.is_locked():
            raise RuntimeError("Cannot publish during site lock")

        self.published = True
        self.publish_status = PublishStatus.PUBLISHED
        self.last_updated = datetime.datetime.now()
        logging.info(f"Submission {self.id} published at {self.last_updated}")

class SubmissionsManager:
    def __init__(self):
        self.submissions = {}
        self.published_submissions = []

    def create_submission(self, creator: str) -> Submission:
        sub_id = f"SUB-{datetime.datetime.now().strftime('%Y%m%d%H%M%S')}"
        submission = Submission(sub_id, creator, datetime.datetime.now())
        self.submissions[sub_id] = submission
        logging.info(f"Created new submission {sub_id} by {creator}")
        return submission

    def get_submission(self, submission_id: str) -> Optional[Submission]:
        return self.submissions.get(submission_id)

    def get_published_submissions(self) -> List[Submission]:
        return [sub for sub in self.submissions.values() if sub.published]

    def process_deletions(self, date: datetime.date):
        count = 0
        for sub_id, submission in list(self.submissions.items()):
            if submission.created_at.date() == date:
                del self.submissions[sub_id]
                count += 1
        logging.info(f"Deleted {count} submissions for date {date}")

