class FDPSManager:
    def __init__(self):
        self.last_checked = None
        self.last_change = None

    def has_fdps_changed(self) -> bool:
        current_time = datetime.datetime.now()
        if not self.last_checked:
            self.last_checked = current_time
            return True

        # Simulate checking for changes (would query database in real implementation)
        changed = False
        if (current_time - self.last_checked).total_seconds() > 3600:  # 1 hour threshold
            changed = True
            self.last_change = current_time

        self.last_checked = current_time
        return changed

